import { createRouter, createWebHashHistory } from 'vue-router'

import Equipmentlist from '../screens/equipmentlist/equipmentlist.vue'
// import Locationslist from '../screens/locationslist/locationslist.vue'

const routes = [
  { path: '/', name: 'EquipmentList', component: Equipmentlist },
  // { path: '/second', name: 'LocationList', component: Locationslist }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
